const navLinks = [
  {
    path: "/dashboard",
    icon: "ri-apps-2-line",
    display: "Dashboard",
  },
  {
    path: "/createTask",
    icon: "ri-edit-2-line",
    display: "Create Task",
  },
  {
    path: "/newTask",
    icon: "ri-bar-chart-horizontal-line",
    display: "NewTask",
  },
  {
    path: "/inprogress",
    icon: "ri-timer-flash-line",
    display: "In Progress",
  },
  {
    path: "/completed",
    icon: "ri-checkbox-circle-fill",
    display: "Completed",
  },
  {
    path: "/canceled",
    icon: "ri-close-circle-line",
    display: "Canceled",
  },
  {
    path: "/setting",
    icon: "ri-settings-2-line",
    display: "Settings",
  },
];

export default navLinks;
